function countUniqueBlackPixels(picture) {
    let [rowsCount, colsCount] = [picture.length, picture[0].length];
    let [rows, cols] = [new Array(rowsCount).fill(0), new Array(colsCount).fill(0)];
    for (let i = 0; i < rowsCount; i++) {
        for (let j = 0; j < colsCount; j++) {
            if (picture[i][j] == 'B') {
                rows[i] += 1;
                cols[j] += 1;
            }
        }
    }
    let uniqueBlackPixelsCount = 0;
    for (let i = 0; i < rowsCount; i++) {
        if (rows[i] == 1) {
            for (let j = 0; j < colsCount; j++) {
                if (picture[i][j] == 'B' && cols[j] == 1) {
                    uniqueBlackPixelsCount += 1;
                    break;
                }
            }
        }
    }
    return uniqueBlackPixelsCount;
}
